import "./App.css";
import Login from "./Login.js";
import HomePage from "./HomePage.js";
import { defaultServer, loggedIn } from "./Util.js";

function App() {

  // Check localStorage once on initial load
  useEffect(() => {
    const token = localStorage.getItem("https://localhost:2000:authToken");
    if (token && token.trim() !== "") {
      setIsLoggedIn(true);
    }
  }, []);

  return (
    <div className="App">
      {loggedIn(defaultServer) ? (
        <HomePage />
      ) : (
        <Login />
      )}
    </div>
  );
}

export default App;
